import "./Contact.css";
import "../App.css";
import Footer from "./Footer";

function Contact() {
  return (
    <>
      <div className="container">
        <h1 className="page-title">Contact</h1>
        <hr></hr>
      </div>
      <Footer />
    </>
  );
}

export default Contact;
